# SCRIPT TO CREATE CONSENSUS SEQS FOR EACH CLUSTER CHOSEN AND ALIGNED
# USES A MODIFIED VERSION OF SIMPLEALIGN _consensus_aa SUB THAT USES ONLY NON GAP CHARACTERS TO CALCULATE 
# TOTAL NUMBER OF SEQS FOR THRESHOLD COMPARISON
# PLAYED WITH METHODS TO REMOVE INDEL COLUMNS THAT APPEAR TO BE SEQUENCING ERROR BUT IT WAS UNSUCCESSFUL

use strict;
use warnings;
use Bio::AlignIO;
use Bio::SimpleAlign;
use List::Util 'sum';
use diagnostics;

$| = 1;

# MODIFIED IUPAC CONSENSUS SUB FROM BIO::SIMPLEALIGN WHICH WILL CALL AMBIGUITIES ONLY WHEN MINOR ALLELE(S) MEET THRESHOLD NUMBERS

BEGIN {
	package Bio::SimpleAlign;
	use List::Util 'max';
	no warnings 'redefine';

	*_consensus_iupac = sub {
		my ($self, $column) = @_;
		my ($string, $char, $rna);
		
		#determine all residues in a column
		foreach my $seq ( $self->each_seq() ) {
			$string .= substr($seq->seq, $column, 1);
		}
		$string = uc $string;

		# if there are only gap characters RETURN
		return '-' if $string =~ /^\W+$/;

		# treat RNA as DNA in regexps
		if ($string =~ /U/) {
		$string =~ s/U/T/;
		$rna = 1;
		}

# 		my $length = CORE::length($string);
		my @l = ($string =~ /[A-Z]/g);
		my $length = @l;
		my $maj = 0.5 * $length;
		my $minprop = 0.05 * $length;
		my $min = 3;
		
		# GET COUNTS OF EACH BASE IN COLUMN
		my @As = ($string =~ /A/g);
		my $Acount = @As;
		my @Gs = ($string =~ /G/g);
		my $Gcount = @Gs;
		my @Cs = ($string =~ /C/g);
		my $Ccount = @Cs;
		my @Ts = ($string =~ /T/g);
		my $Tcount = @Ts;
		
		my @list = ($Acount, $Gcount, $Ccount, $Tcount);
		my $max = max( @list );
		
# 		print "column: $column\n";
# 		print "A: $Acount\tG: $Gcount\tC: $Ccount\tT: $Tcount\tmax: $max\n";
# 		print $acFH "$Acount\t$Gcount\t$Ccount\t$Tcount\n";
# 		
# 		die;
		
		if ($Acount == $max) {
			$char = 'A';											# A						A
			if ($Gcount >= $minprop && $Gcount >= $min) {
				$char = 'R'; 										# A and G (purines)		R
				if ($Ccount >= $minprop && $Ccount >= $min) {
					$char = 'V'; 									# A and G and C			V
					if ($Tcount >= $minprop && $Tcount >= $min) {
						$char = 'N'; 								# A and G and C and T	N
					}
				}elsif ($Tcount >= $minprop && $Tcount >= $min) {
					$char = 'D'; 									# A and G and T			D
				}
			}elsif ($Ccount >= $minprop  && $Ccount >= $min) {
				$char = 'M'; 										# A and C               M
				if ($Tcount >= $minprop && $Tcount >= $min) {
					$char = 'H'; 									# A and C and T         H
				}
			}elsif ($Tcount >= $minprop && $Tcount >= $min) {
				$char = 'W';										# A and T               W
			}
		}elsif ($Ccount == $max) {									# C						C
			$char = 'C';
			if ($Gcount >= $minprop && $Gcount >= $min) {			# C and G				S
				$char = 'S'; 					
				if ($Acount >= $minprop && $Acount >= $min) {		# C and G and A			V
					$char = 'V'; 				
					if ($Tcount >= $minprop && $Tcount >= $min) {	# C and G and A and T	N
						$char = 'N';
					}
				}elsif ($Tcount >= $minprop && $Tcount >= $min) {						# C and G and T			B
					$char = 'B'; 				
				}
			}elsif ($Acount >= $minprop && $Acount >= $min) {		# C and A				M
				$char = 'M';
				if ($Tcount >= $minprop && $Tcount >= $min) {		# C and A and T			H
					$char = 'H';
				}
			}elsif ($Tcount >= $minprop && $Tcount >= $min) {		# C and T				Y
				$char = 'Y';					
			}
		} elsif ($Gcount == $max) {									# C						C
			$char = 'G';
			if ($Acount >= $minprop && $Gcount >= $min) {
				$char = 'R'; 										# G and A (purines)      R
				if ($Ccount >= $minprop && $Ccount >= $min) {
					$char = 'V'; 									# G and A and C          V
					if ($Tcount >= $minprop && $Tcount >= $min) {
						$char = 'N'; 								# G and A and C and T    N
					}
				}elsif ($Tcount >= $minprop && $Tcount >= $min) {
					$char = 'D'; 									# G and A and T          D
				}
			}elsif ($Ccount >= $minprop && $Ccount >= $min) {
				$char = 'S'; 										# G and C   		     S
				if ($Tcount >= $minprop && $Tcount >= $min) {
					$char = 'B'; 									# G and C and T          B
				}
			}elsif ($Tcount >= $minprop && $Tcount >= $min) {
				$char = 'K';										# G and T                K
			}
		} elsif ($Tcount == $max) {
			$char = 'T';
			if ($Acount >= $minprop && $Acount >= $min) {			# T and A				W
				$char = 'W'; 										
				if ($Ccount >= $minprop && $Ccount >= $min) {		# T and A and C			H
					$char = 'H'; 									
					if ($Gcount >= $minprop && $Gcount >= $min) {	# T and A and C and G	N
						$char = 'N';							
					}
				}elsif ($Gcount >= $minprop && $Gcount >= $min) {	# T and A and G			D
					$char = 'D'; 									
				}
			}elsif ($Ccount >= $minprop && $Ccount >= $min) {		# T and C				Y
				$char = 'Y';
				if ($Gcount >= $minprop && $Gcount >= $min) {		# T and C and G			B
					$char = 'B';
				}
			}elsif ($Gcount >= $minprop && $Gcount >= $min) {		# T and G				K
				$char = 'K';
			}

		}
# 		print "$char\n";
		$char = 'U' if $rna and $char eq 'T';
		$char = lc $char if ($string =~ /\W/);

		return $char;
	}
}

BEGIN {
	package Bio::SimpleAlign;
	use List::Util 'sum';
	no warnings 'redefine';
# 	FOR CURRENT POSITION, CALCULATE CONSENSUS BASE
	*_consensus_aa = sub {
		my $self = shift;
		my $point = shift;
		my $threshold_percent = shift || -1 ;
		my ($seq,%hash,$count,$letter,$key);
		my $gapchar = $self->gap_char;

# 		CREATE A HASH OF LETTER COUNTS FOR CURRENT POSITION
		%hash = $self->_consensus_counts($point);
		my $number_of_sequences = $self->num_sequences();

	# 	Modifying threshold to ignore gap characters
# 	  my $threshold = $number_of_sequences * $threshold_percent / 100. ;

		$count = -1;
	#   changing default letter to N from ?
		$letter = 'N';

		foreach $key ( sort keys %hash ) {
			# print "Now at $key $hash{$key}\n";
		# 	Modifying threshold to ignore gap characters
			my $sum = sum (values %hash);
			my $threshold_use = $sum * $threshold_percent / 100. ;
			
			if( $hash{$key} > $count && $hash{$key} >= $threshold_use) {
				$letter = $key;
				$count = $hash{$key};
			}
		}
		return $letter;
	}
}

